PRAGMA defer_foreign_keys=TRUE;
CREATE TABLE d1_migrations(
		id         INTEGER PRIMARY KEY AUTOINCREMENT,
		name       TEXT UNIQUE,
		applied_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP NOT NULL
);
CREATE TABLE centrales (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  nom TEXT UNIQUE NOT NULL,
  type TEXT NOT NULL CHECK(type IN ('SOL', 'TOITURE')),
  puissance_kwc REAL,
  localisation TEXT,
  statut TEXT DEFAULT 'A_AUDITER' CHECK(statut IN ('A_AUDITER', 'EN_COURS', 'TERMINE', 'VALIDE')),
  date_creation DATETIME DEFAULT CURRENT_TIMESTAMP,
  date_audit DATETIME,
  date_validation DATETIME
, latitude REAL, longitude REAL, distance_toulouse_km REAL, distance_lyon_km REAL, base_proche TEXT, dept TEXT, id_ref TEXT, sous_traitant_prevu TEXT, spv TEXT, adresse TEXT, type_centrale TEXT, installateur TEXT, date_mes TEXT, si TEXT, panneaux TEXT, contact_exploitation TEXT, tel_exploitation TEXT, contact_gestion TEXT, tel_gestion TEXT, audit_toiture TEXT, audit_hors_toiture TEXT, ratio_pr TEXT, date_prev_audit TEXT);
CREATE TABLE stats_mission (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  date_snapshot DATETIME DEFAULT CURRENT_TIMESTAMP,
  centrales_total INTEGER,
  centrales_auditees INTEGER,
  centrales_validees INTEGER,
  photos_total INTEGER,
  volumetrie_json_mb REAL,
  volumetrie_photos_mb REAL,
  heures_terrain_estimees REAL
);
CREATE TABLE sous_traitants (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  nom_entreprise TEXT UNIQUE NOT NULL,
  email_contact TEXT,
  telephone TEXT,
  adresse TEXT,
  siret TEXT,
  contact_principal TEXT,
  statut TEXT DEFAULT 'ACTIF' CHECK(statut IN ('ACTIF', 'INACTIF', 'SUSPENDU')),
  date_creation DATETIME DEFAULT CURRENT_TIMESTAMP,
  date_modification DATETIME DEFAULT CURRENT_TIMESTAMP,
  notes TEXT
);
CREATE TABLE techniciens (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  sous_traitant_id INTEGER NOT NULL,
  prenom TEXT NOT NULL,
  nom TEXT NOT NULL,
  email TEXT UNIQUE,
  telephone TEXT,
  statut TEXT DEFAULT 'DISPONIBLE' CHECK(statut IN ('DISPONIBLE', 'OCCUPE', 'INDISPONIBLE', 'CONGE')),
  date_creation DATETIME DEFAULT CURRENT_TIMESTAMP,
  date_modification DATETIME DEFAULT CURRENT_TIMESTAMP,
  notes TEXT,
  FOREIGN KEY (sous_traitant_id) REFERENCES sous_traitants(id) ON DELETE CASCADE
);
CREATE TABLE ordres_mission (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  centrale_id INTEGER NOT NULL,
  technicien_id INTEGER NOT NULL,
  sous_traitant_id INTEGER NOT NULL,
  date_mission DATE NOT NULL,
  heure_debut TIME,
  heure_fin TIME,
  duree_estimee_heures REAL DEFAULT 7.0,
  statut TEXT DEFAULT 'PLANIFIE' CHECK(statut IN ('PLANIFIE', 'CONFIRME', 'EN_COURS', 'TERMINE', 'VALIDE', 'ANNULE', 'REPORTE')),
  checklist_generee BOOLEAN DEFAULT 0,
  ordre_mission_pdf TEXT, 
  date_creation DATETIME DEFAULT CURRENT_TIMESTAMP,
  date_validation DATETIME,
  date_annulation DATETIME,
  commentaires TEXT,
  raison_annulation TEXT,
  FOREIGN KEY (centrale_id) REFERENCES centrales(id) ON DELETE CASCADE,
  FOREIGN KEY (technicien_id) REFERENCES techniciens(id) ON DELETE CASCADE,
  FOREIGN KEY (sous_traitant_id) REFERENCES sous_traitants(id) ON DELETE CASCADE,
  UNIQUE(centrale_id) 
);
CREATE TABLE planning_events (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  ordre_mission_id INTEGER NOT NULL,
  centrale_id INTEGER NOT NULL,
  technicien_id INTEGER NOT NULL,
  sous_traitant_id INTEGER NOT NULL,
  date_debut DATETIME NOT NULL,
  date_fin DATETIME NOT NULL,
  titre TEXT NOT NULL,
  description TEXT,
  couleur TEXT DEFAULT '#3b82f6', 
  statut TEXT DEFAULT 'PLANIFIE',
  FOREIGN KEY (ordre_mission_id) REFERENCES ordres_mission(id) ON DELETE CASCADE,
  FOREIGN KEY (centrale_id) REFERENCES centrales(id) ON DELETE CASCADE,
  FOREIGN KEY (technicien_id) REFERENCES techniciens(id) ON DELETE CASCADE,
  FOREIGN KEY (sous_traitant_id) REFERENCES sous_traitants(id) ON DELETE CASCADE
);
CREATE TABLE checklist_items (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  ordre_mission_id INTEGER NOT NULL,
  categorie TEXT NOT NULL,
  item_numero INTEGER NOT NULL,
  item_texte TEXT NOT NULL,
  statut TEXT DEFAULT 'NON_VERIFIE' CHECK(statut IN ('CONFORME', 'NON_CONFORME', 'A_VERIFIER', 'NON_VERIFIE')),
  conformite INTEGER,
  commentaire TEXT,
  photo_base64 TEXT,
  photo_filename TEXT,
  mesure_valeur REAL,
  mesure_unite TEXT,
  technicien_nom TEXT,
  date_creation DATETIME DEFAULT CURRENT_TIMESTAMP,
  date_modification DATETIME DEFAULT CURRENT_TIMESTAMP,
  FOREIGN KEY (ordre_mission_id) REFERENCES ordres_mission(id) ON DELETE CASCADE
);
CREATE TABLE audit_photos (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  ordre_mission_id INTEGER NOT NULL,
  checklist_item_id INTEGER,
  filename TEXT NOT NULL,
  url TEXT,
  blob_data TEXT,
  taille_bytes INTEGER,
  mime_type TEXT DEFAULT 'image/jpeg',
  latitude REAL,
  longitude REAL,
  date_prise DATETIME DEFAULT CURRENT_TIMESTAMP,
  legende TEXT,
  FOREIGN KEY (ordre_mission_id) REFERENCES ordres_mission(id) ON DELETE CASCADE,
  FOREIGN KEY (checklist_item_id) REFERENCES checklist_items(id) ON DELETE CASCADE
);
CREATE TABLE retours_json (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  ordre_mission_id INTEGER NOT NULL,
  centrale_id INTEGER NOT NULL,
  technicien_id INTEGER NOT NULL,
  json_data TEXT NOT NULL,
  nb_photos INTEGER DEFAULT 0,
  taille_mo REAL DEFAULT 0,
  statut TEXT DEFAULT 'BROUILLON' CHECK(statut IN ('BROUILLON', 'ENVOYE', 'VALIDE', 'REJETE')),
  date_upload DATETIME DEFAULT CURRENT_TIMESTAMP,
  date_validation DATETIME,
  validateur_id INTEGER,
  commentaires_validateur TEXT,
  FOREIGN KEY (ordre_mission_id) REFERENCES ordres_mission(id) ON DELETE CASCADE,
  FOREIGN KEY (centrale_id) REFERENCES centrales(id) ON DELETE CASCADE,
  FOREIGN KEY (technicien_id) REFERENCES techniciens(id) ON DELETE CASCADE
);
CREATE TABLE audits_checklists (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    centrale_id TEXT NOT NULL,
    date_audit TEXT NOT NULL,
    auditeur TEXT NOT NULL,
    sous_traitant TEXT NOT NULL,
    data_json TEXT NOT NULL,
    statut TEXT DEFAULT 'EN_COURS',
    created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
    updated_at DATETIME DEFAULT CURRENT_TIMESTAMP,
    sharepoint_url TEXT,
    FOREIGN KEY (centrale_id) REFERENCES centrales(id)
);
CREATE TABLE audits_photos (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    centrale_id TEXT NOT NULL,
    filename TEXT NOT NULL,
    latitude REAL,
    longitude REAL,
    timestamp TEXT NOT NULL,
    description TEXT,
    sharepoint_url TEXT,
    created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (centrale_id) REFERENCES centrales(id)
);
CREATE TABLE audits_annexe2 (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    centrale_id TEXT NOT NULL,
    data_json TEXT NOT NULL,
    statut TEXT DEFAULT 'GENERE',
    created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
    sharepoint_url TEXT,
    FOREIGN KEY (centrale_id) REFERENCES centrales(id)
);
CREATE TABLE audits_rapports (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    centrale_id TEXT NOT NULL,
    date_generation TEXT NOT NULL,
    statut TEXT DEFAULT 'GENERE',
    sharepoint_url TEXT,
    sharepoint_url_final TEXT,
    created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (centrale_id) REFERENCES centrales(id)
);
CREATE TABLE sync_logs (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    type TEXT NOT NULL, 
    status TEXT NOT NULL, 
    message TEXT,
    details TEXT,
    created_at DATETIME DEFAULT CURRENT_TIMESTAMP
);
CREATE TABLE ordres_mission_item_photos (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  ordre_mission_id INTEGER NOT NULL,
  item_checklist_id INTEGER NOT NULL,
  photo_base64 TEXT NOT NULL,
  photo_filename TEXT,
  ordre INTEGER DEFAULT 1,
  commentaire TEXT,
  date_creation DATETIME DEFAULT CURRENT_TIMESTAMP,
  date_modification DATETIME DEFAULT CURRENT_TIMESTAMP,
  FOREIGN KEY (ordre_mission_id) REFERENCES ordres_mission(id) ON DELETE CASCADE,
  FOREIGN KEY (item_checklist_id) REFERENCES ordres_mission_checklist(id) ON DELETE CASCADE
);
CREATE TABLE ordres_mission_commentaires_finaux (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  mission_id INTEGER NOT NULL,
  commentaire_final TEXT,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  updated_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  FOREIGN KEY (mission_id) REFERENCES ordres_mission(id) ON DELETE CASCADE,
  UNIQUE(mission_id)
);
CREATE TABLE ordres_mission_photos_generales (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  mission_id INTEGER NOT NULL,
  filename TEXT NOT NULL,
  photo_base64 TEXT NOT NULL,
  description TEXT,
  uploaded_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  FOREIGN KEY (mission_id) REFERENCES ordres_mission(id) ON DELETE CASCADE
);
CREATE TABLE checklist_items_toiture (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  ordre_mission_id INTEGER NOT NULL,
  item_numero INTEGER NOT NULL,
  libelle TEXT NOT NULL,
  categorie TEXT DEFAULT 'AUDIT_TOITURE',
  statut TEXT DEFAULT 'NON_VERIFIE' CHECK(statut IN ('NON_VERIFIE', 'CONFORME', 'NON_CONFORME', 'N/A')),
  conformite TEXT,
  commentaire TEXT,
  technicien TEXT,
  date_verification DATETIME,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  updated_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  FOREIGN KEY (ordre_mission_id) REFERENCES ordres_mission(id) ON DELETE CASCADE
);
CREATE TABLE checklist_toiture_template (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  item_numero INTEGER NOT NULL,
  libelle TEXT NOT NULL,
  categorie TEXT DEFAULT 'AUDIT_TOITURE',
  description TEXT,
  reference_normative TEXT
);
CREATE TABLE rapports_audits (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  centrale_id INTEGER NOT NULL,
  ordre_mission_id INTEGER,
  titre TEXT NOT NULL,
  type_rapport TEXT DEFAULT 'AUDIT_QUALITE' CHECK(type_rapport IN ('AUDIT_QUALITE', 'AUDIT_TOITURE', 'AUDIT_COMPLET')),
  statut TEXT DEFAULT 'BROUILLON' CHECK(statut IN ('BROUILLON', 'EN_COURS', 'TERMINE', 'VALIDE')),
  date_generation DATETIME DEFAULT CURRENT_TIMESTAMP,
  date_validation DATETIME,
  
  
  auditeur TEXT,
  date_audit DATE,
  nb_items_conformes INTEGER DEFAULT 0,
  nb_items_non_conformes INTEGER DEFAULT 0,
  nb_items_na INTEGER DEFAULT 0,
  
  
  donnees_rapport TEXT, 
  
  
  auteur TEXT, 
  collaborateurs TEXT, 
  
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  updated_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  
  FOREIGN KEY (centrale_id) REFERENCES centrales(id) ON DELETE CASCADE,
  FOREIGN KEY (ordre_mission_id) REFERENCES ordres_mission(id) ON DELETE SET NULL
);
CREATE TABLE rapports_complements (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  rapport_id INTEGER NOT NULL,
  type TEXT CHECK(type IN ('PHOTO', 'COMMENTAIRE', 'OBSERVATION', 'NOTE')) NOT NULL,
  contenu TEXT NOT NULL, 
  titre TEXT,
  description TEXT,
  auteur TEXT, 
  section_rapport TEXT, 
  ordre_affichage INTEGER DEFAULT 0,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  FOREIGN KEY (rapport_id) REFERENCES rapports_audits(id) ON DELETE CASCADE
);
DELETE FROM sqlite_sequence;
CREATE INDEX idx_centrales_statut ON centrales(statut);
CREATE INDEX idx_centrales_type ON centrales(type);
CREATE INDEX idx_stats_date ON stats_mission(date_snapshot DESC);
CREATE INDEX idx_techniciens_sous_traitant ON techniciens(sous_traitant_id);
CREATE INDEX idx_techniciens_statut ON techniciens(statut);
CREATE INDEX idx_ordres_centrale ON ordres_mission(centrale_id);
CREATE INDEX idx_ordres_technicien ON ordres_mission(technicien_id);
CREATE INDEX idx_ordres_sous_traitant ON ordres_mission(sous_traitant_id);
CREATE INDEX idx_ordres_date ON ordres_mission(date_mission);
CREATE INDEX idx_ordres_statut ON ordres_mission(statut);
CREATE INDEX idx_planning_date ON planning_events(date_debut, date_fin);
CREATE INDEX idx_planning_technicien ON planning_events(technicien_id);
CREATE INDEX idx_checklist_mission ON checklist_items(ordre_mission_id);
CREATE INDEX idx_checklist_categorie ON checklist_items(categorie);
CREATE INDEX idx_checklist_statut ON checklist_items(statut);
CREATE INDEX idx_photos_mission ON audit_photos(ordre_mission_id);
CREATE INDEX idx_photos_checklist ON audit_photos(checklist_item_id);
CREATE INDEX idx_retours_mission ON retours_json(ordre_mission_id);
CREATE INDEX idx_retours_statut ON retours_json(statut);
CREATE INDEX idx_centrales_sous_traitant_prevu ON centrales(sous_traitant_prevu);
CREATE INDEX idx_centrales_dept ON centrales(dept);
CREATE INDEX idx_centrales_gps ON centrales(latitude, longitude);
CREATE INDEX idx_centrales_date_mes ON centrales(date_mes);
CREATE INDEX idx_centrales_contact_exploitation ON centrales(contact_exploitation);
CREATE INDEX idx_audits_checklists_centrale ON audits_checklists(centrale_id);
CREATE INDEX idx_audits_photos_centrale ON audits_photos(centrale_id);
CREATE INDEX idx_audits_annexe2_centrale ON audits_annexe2(centrale_id);
CREATE INDEX idx_audits_rapports_centrale ON audits_rapports(centrale_id);
CREATE INDEX idx_sync_logs_type ON sync_logs(type);
CREATE INDEX idx_sync_logs_created ON sync_logs(created_at);
CREATE INDEX idx_item_photos_mission ON ordres_mission_item_photos(ordre_mission_id);
CREATE INDEX idx_item_photos_item ON ordres_mission_item_photos(item_checklist_id);
CREATE INDEX idx_item_photos_ordre ON ordres_mission_item_photos(ordre_mission_id, item_checklist_id, ordre);
CREATE INDEX idx_commentaires_finaux_mission ON ordres_mission_commentaires_finaux(mission_id);
CREATE INDEX idx_photos_generales_mission ON ordres_mission_photos_generales(mission_id);
CREATE INDEX idx_checklist_toiture_mission ON checklist_items_toiture(ordre_mission_id);
CREATE INDEX idx_checklist_toiture_statut ON checklist_items_toiture(statut);
CREATE INDEX idx_rapports_centrale ON rapports_audits(centrale_id);
CREATE INDEX idx_rapports_statut ON rapports_audits(statut);
CREATE INDEX idx_rapports_date ON rapports_audits(date_generation);
CREATE INDEX idx_complements_rapport ON rapports_complements(rapport_id);
CREATE TRIGGER update_checklist_toiture_timestamp 
AFTER UPDATE ON checklist_items_toiture
BEGIN
  UPDATE checklist_items_toiture SET updated_at = CURRENT_TIMESTAMP WHERE id = NEW.id;
END;
CREATE TRIGGER update_rapports_timestamp 
AFTER UPDATE ON rapports_audits
BEGIN
  UPDATE rapports_audits SET updated_at = CURRENT_TIMESTAMP WHERE id = NEW.id;
END;
