INSERT INTO "checklist_toiture_template" VALUES(1,1,'Démontage/remontage ~25 panneaux pertinents','AUDIT_TOITURE','Démontage d''au moins 25 panneaux pertinents (1er et dernier panneau d''une chaîne, etc.). Remontage sans atteinte à l''intégrité des panneaux ou de leurs supports.','CDC Girasole §2.2');
INSERT INTO "checklist_toiture_template" VALUES(2,2,'Conformité DTU 40.35','AUDIT_TOITURE','Vérification de la conformité aux règles du DTU 40.35 (couvertures par éléments métalliques en feuilles et longues feuilles en zinc).','DTU 40.35');
INSERT INTO "checklist_toiture_template" VALUES(3,3,'Qualité montage/serrage SI sur support','AUDIT_TOITURE','Contrôle de la qualité et conformité du montage et serrage des Structures d''Intégration (SI) sur leur support.','CDC Girasole page 8');
INSERT INTO "checklist_toiture_template" VALUES(4,4,'Qualité montage/serrage panneaux sur SI','AUDIT_TOITURE','Contrôle de la qualité et conformité du montage et serrage des panneaux photovoltaïques sur les structures d''intégration.','CDC Girasole page 8');
INSERT INTO "checklist_toiture_template" VALUES(5,5,'Fixation cheminement câbles (supports, étanchéité)','AUDIT_TOITURE','Contrôle de la fixation du cheminement des câbles : pertinence des supports de fixation, maintien de l''étanchéité toiture, absence de percement non maîtrisé.','CDC Girasole page 8');
INSERT INTO "checklist_toiture_template" VALUES(6,6,'Compatibilité/serrage/étanchéité connecteurs MC4','AUDIT_TOITURE','Contrôle des raccordements : compatibilité des connecteurs mâle/femelle (type PVZH202B), serrages corrects, étanchéité assurée, protection contre ruissellement.','CDC Girasole page 8');
INSERT INTO "checklist_toiture_template" VALUES(7,7,'Qualité cheminement câbles DC dans chemins de câbles','AUDIT_TOITURE','Contrôle de la qualité du cheminement des câbles DC dans les chemins de câbles : fixation adéquate, rayons de courbure respectés, absence de contraintes mécaniques.','CDC Girasole page 8');
INSERT INTO "checklist_toiture_template" VALUES(8,8,'Cheminement câbles (pas directement sur couverture)','AUDIT_TOITURE','Vérification que les câbles ne cheminent PAS directement sur la couverture. Utilisation obligatoire de supports adaptés.','CDC Girasole page 8');
INSERT INTO "checklist_toiture_template" VALUES(9,9,'Raccordements terres','AUDIT_TOITURE','Contrôle de la qualité du cheminement et du raccordement des terres : continuité électrique, serrage des connexions, utilisation de cosses adaptées.','CDC Girasole page 8');
INSERT INTO "checklist_toiture_template" VALUES(10,10,'Étiquettes réglementaires tension DC','AUDIT_TOITURE','Présence et conformité des étiquettes réglementaires indiquant la présence de tension DC dangereuse.','CDC Girasole page 8 + Réglementation');
INSERT INTO "checklist_toiture_template" VALUES(11,11,'Respect notices montage / Interdiction marcher sur panneaux','AUDIT_TOITURE','Vérification du respect des notices de montage des panneaux. Contrôle visuel qu''aucune trace de passage sur panneaux n''est visible. INTERDICTION ABSOLUE de marcher sur les panneaux pendant l''audit.','CDC Girasole §2.2');
